Count 1 - Possess THC with Intent to Deliver - Guilty plea.  Convicted.  State moves to dismiss and read in count 2, conspiracy to deliver THC and count 3, bail jumping.   Motion granted.   Sentence is withheld.   Defendant is placed on probation to DOC for three (3) years.  Conditions of probation are:
1) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process;
2) AODA assessment and follow through;
3) Submit to random urine screens and pay for same;
4) Spend five (5) months in the Manitowoc County Jail, under the Huber Law, to commence immediately;
5) Maintain full-time employment/schooling combination;
6) Submot DNA sample and pay surcharge;
7) Pay costs of action; 
8) Pay supervision fees in an amount to be determined by DOC.  
Plea Questionnaire/Waiver of Rights. 
Notice of Right to Seek Postconviction Relief. 
Ineligible Voting Notice & Acknowledgment.   
